import classes from './SingUp.module.css';

const SingUp = () => {
  return (
    <div className={classes.Box}>
      <h1>Sign Up:</h1>
      <input
        className={classes.Input}
        type="text"
        placeholder={'Username'}
      />
      <input
        className={classes.Input}
        type="email"
        placeholder={'E-mail'}
      />
      <input
        className={classes.Input}
        type="Password"
        placeholder={'Password'}
      />
      <button className={classes.Btn}>Sing Up</button>
    </div>
  );
};

export default SingUp;
